import React from "react";

class VideoModule extends React.Component {
  constructor(props) {
    super(props);
    this.state = { module: props.module };
  }
  render() {
    console.log(this.state.module);
    return (
      <div className="uk-width-1-1@s uk-width-2-3@m uk-row-first">
        <video
          src="https://yootheme.com/site/images/media/yootheme-pro.mp4"
          controls
          playsinline
          hidden
          uk-video
        />
        <iframe
          className="uk-responsive-width"
          src={this.state.module.src}
          width={this.state.module.width}
        />
      </div>
    );
  }
}

export default VideoModule;

